import React from 'react';
import { AppBar, Toolbar, Button, Box } from '@mui/material';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <AppBar
      position="static"
      sx={{
        backgroundColor: '#d84315',
        borderRadius: '30px',
        marginBottom: '20px',
        padding: '0 20px',
        boxShadow: '0px 4px 10px rgba(0, 0, 0, 0.1)',
      }}
    >
      <Toolbar sx={{ justifyContent: 'space-between' }}>
        {/* Navigation Buttons */}
        <Box>
          <Button
            component={Link}
            to="/"
            color="inherit"
            sx={{
              fontSize: '1.2rem',
              padding: '10px 20px',
              marginLeft: '15px',
              '&:hover': {
                backgroundColor: '#ff7043',
                color: '#fff',
              },
            }}
          >
            Home
          </Button>
          <Button
            component={Link}
            to="/blogs"
            color="inherit"
            sx={{
              fontSize: '1.2rem',
              padding: '10px 20px',
              marginLeft: '15px',
              '&:hover': {
                backgroundColor: '#ff7043',
                color: '#fff',
              },
            }}
          >
            Blogs
          </Button>
          <Button
            component={Link}
            to="/about"
            color="inherit"
            sx={{
              fontSize: '1.2rem',
              padding: '10px 20px',
              marginLeft: '15px',
              '&:hover': {
                backgroundColor: '#ff7043',
                color: '#fff',
              },
            }}
          >
            About
          </Button>
        </Box>
      </Toolbar>
    </AppBar>
  );
};

export default Navbar;
